{"6": ["Ну для своей цены хороший шурик. 100мм саморезы со скрипом, но закрутил в сухое дерево, последние 20мм дались ему достаточно тяжело при полностью заряженном аккумуляторе. Металл в пределах разумного сверлит.\n Это бытовой шурик и не стоит от него ожидать показателей промышленных шуруповертов за 10к+ рублей. Для мелкого ремонта отлично подходит. Закрутить, открутить, просвелить отверстия в дереве, небольшие отверстия в металле. Но что-то серьёзное им лучше не делать, думаю не вывезет. Если хотите сверлить стены, кирпич или бетон лучше купите обычную дрель.", "2021-04-15T17:57:44Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "15": ["Бьет патрон", "2021-04-03T16:41:44Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "16": ["Бьёт патрон на шуруповерте. В остальном проблем нет, АКБ держат заряд.", "2021-04-01T11:11:19Z", "черный", "0", 1, 0, 2, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "18": ["Не нарадуюсь. Для домашнего ремонта самое то.", "2021-03-31T15:21:56Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "19": ["Пришел данный дивайс быстро, но пришлось вернуть, при проверке в офисе валбирис обнаружились следующие неисправности: биение патрона и переключение скоростей не работает.", "2021-03-31T10:08:13Z", "черный", "0", 2, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "20": ["Первый заказывал из китая качество было отлично кнопки нажимались мягко все работало ровно,с этим все наоборот,головка шуруповериа крутится не ровно,свёрла гуляют по овалу,получаются неровные отверстия,кнопки очень жёстки", "2021-03-31T07:16:43Z", "черный", "0", 2, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "21": ["Это жесть ребята!!! Бита крестовая из набора была использована, стерты все грани!!! Конечно это тупость ради этого отправлять шуруповерт назад, но блин неприятно((( ", "2021-03-30T16:18:03Z", "черный", "0", 2, 0, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "22": ["Качество вроде норм, не Макита конечно но за эти деньги топ ,но на 2 передаче когда упирается сверло выключаются и включается только после 3 нажатия", "2021-03-27T18:13:44Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "27": ["Шуруповерт хороший.все работает", "2021-03-23T09:55:10Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "30": ["Брал в июле 2020г. Очень устраивает работоспособность и компактность. Аккумы ёмкость пока не потеряли. Заряжал каждый примерно по 15 раз. Реально долго держат заряд при работе, но и долго однако заражаются - почти 3 часа. Большой мощности ( крутящего момента) особо не ждите. На бытовом уровне и по работе во дворе частного дома - вполне на достойном уровне!", "2021-03-16T19:23:46Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "34": ["Нормальный шурик за свою цену. Биты можно сразу выбросить.", "2021-03-10T02:25:09Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "35": ["Купила сыну для использования дома, хорошая дрель - шуруповерт.", "2021-03-09T08:38:16Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "36": ["2000!!!это супер шурик за свои деньги!Прошел весь полугодовой капитальный ремонт и выглядит как новый.Перепаял аккумуляторы на (шоколадки )LG HG2 ,но и и старые три аккумулятора в блоке не плохие ,честные 1400 mAh каждый,что за такую цену очень даже!", "2021-03-08T18:51:53Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "37": ["Товар соответствует. Но на патроне был затянут винт. Поэтому не дожимал сверло. Отпустил против часовой до конца, и все чётко работает. Аккумы заряжены зарядка работает. ЗАЧЁТ. ВСЕМ ДОБРА. ", "2021-03-08T17:11:03Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "51": ["Шуруповерт хороший. Мужу понравился. Снимаю звезду за один неработающий аккумулятор. Наличие двух аккумуляторов было одним из критериев выбора шуруповерта.", "2021-02-23T07:09:58Z", "черный", "0", 1, 0, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "54": ["Один аккумулятор не рабочий, второй  разряжается очень быстро производитель дефект не признает отправляет в сервис. В моем городе сервисов нет. Заморачиваться с отправкой на диагностику транспортной компанией-не вариант.\nДанная покупка-деньги на ветер.", "2021-02-21T17:17:47Z", "черный", "0", 2, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "58": ["Один из аккумуляторов не работает\nХочу вернуть деньги обратно", "2021-02-19T19:45:26Z", "черный", "0", 1, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "60": ["К сожалению не работает один аккумулятор ", "2021-02-18T18:05:27Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "66": ["Для периодического использования дома прокатит. Фирма и качество китайские, это не стереотип.... Пришло запечатанным в пластик. Привезли с опозданием. Комплект как на фото продавца. Оба аккума работают, патрон пока не вывалился. Качество пластика и резинок китайское. Подгонка деталей китайская, аккум вставляется с удара. На ощупь китай. Достаточно тяжёлый для такого размера. Про качество свёрел и бит говорить не буду, из наборов их сразу обычно отправляют в помойку (опыт). Кто держал в руках инструмент приличного качества (про лидеров рынка не говорю, хотя ориентироваться на них стоит), тот поймёт о чём я сейчас говорил. И должен заметить, для такого качества ценник завышен. Но если вы не \"гурман\" и \"шурик\" нужен от случая к случаю - брать можно. Учитываем, гарантийный талон девственно чист. Хотя на нём на русском написано про то, что не заполненый он не действителен (это желающим если что случиться отремонтировать по гарантии).", "2021-02-15T17:27:37Z", "черный", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "67": ["Заказывал 30 ноября пришло 2 декабря. Товаром доволен! Приего помощи собирал и мебель и ремонт делал крутит сверлит все отлично. Аккумуляторы оба рабочие заряжается примерно полтора часа. Рекомендую не дорого работает хорошо", "2021-02-14T07:03:40Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "69": ["Шуруповёрт хороший, но пришел с одним не рабочим аккумулятором. Поэтому отказ, буду перезаказывать.", "2021-02-13T10:49:56Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "75": ["Рекомендую однозначно ", "2021-02-07T15:44:22Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "94": ["Не работает один акамулятор, горит индикатор что заряжен, но и не работает, очень разочаван, не советую!!!!!!", "2021-01-14T17:51:06Z", "черный", "0", 1, 2, 2, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "101": ["Перестал заряжаться через месяц использования", "2021-01-10T11:44:38Z", "черный", "0", 2, 0, 2, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "102": ["Добрый день! В место дрели - шуруповёрт пришёл гель для тела! Как так! Поставили на возврат + 100 сняли! Просто ужас!😳", "2021-01-10T10:00:35Z", "черный", "0", 2, 1, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "104": ["Пришёл в пыльном ,  грязном кейсе , без коробочки , брала на подарок , как-то некрасиво что небыло заводской упаковки. Внешне вроде не использовался .", "2020-01-06T19:10:41.518505181Z", "черный", "0", 0, 2, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "106": ["Шуруповерт хороший за свои деньги. Пришёл с одной заряженной батареей , проверили все работает, заряжается. Муж доволен. Для дома самое то.", "2021-01-09T03:08:25Z", "черный", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "108": ["Товар пришел в конце февраля. Пользовался в течение трех недель дома. Потом зарядил аккумуляторы и убрал на полку. В сентябре пользовался два дня. Затем также, зарядив аккумуляторы, убрал на полку. Перед новым годом нужно было привернуть плинтусы. Достал шуруповерт, оба аккума разряжены. Удивился, но поставил заряжаться. В итоге один аккумулятор зарядился, второй светится зеленым. Что значит что заряжен, но аппарат не вращается. Гарантия еще не вышла, но в личном кабинете написано \"Невозвратный товар\". Буду бодаться с ВБ, чтобы поменяли вышедший из строя аккумулятор.", "2021-01-06T14:05:11Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "109": ["Доставка была очень долгой! А так всё хорошо.\n", "2021-01-04T17:53:08Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "115": ["Хороший шуруповерт, взяли второй", "2020-12-29T12:56:09Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "117": ["Упакован норм, в работе не опробовала, позже напишу отзыв", "2020-12-25T07:02:09Z", "черный", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "118": ["После двух зарядок, один аккумулятор вышел из строя.", "2020-12-21T15:13:02Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "120": ["Легкий удобный шуруповерт. Довольно слабый при этом. Во время работы по дереву, саморезы в просверленном под размер отверстии докручивал отверткой. Когда доходило до шляпки, срабатывала трещетка. Оба аккумулятора в комплекте исправны, чему был приятно удивлен. Во многих отзывах описывается проблема неработающего запасного аккумулятора. Мне кажется, стоит рискнуть и взять. Вероятно, в новой партии эту проблему уже исправили.", "2020-12-17T19:59:30Z", "черный", "0", 0, 2, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "121": ["Второй аккумулятор оказался бракованный и не работает", "2020-12-15T16:01:13Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "122": ["За такие деньги отличный вариант заказом доволен все работает на ура . дальнейшее будет видно а так супер", "2020-06-13T15:32:47.809926507Z", "черный", "0", 2, 1, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "125": ["За 4 месяца пользовался им максимум раз 6... Сегодня понадобился вновь, и вот сюрприз, одна из батарей отказалась заряжаться, при подключении зарядного показывает что она заряжена (горит зелёный индикатор),  но шуруповёрт отказывается от нее работать. Печально. Вторая батарея пока жива.", "2020-12-13T16:46:24Z", "черный", "0", 2, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "126": ["Добрый день! Шуруповёрт пришёл быстро, всё соответствует описанию. Мне очень понравилось. Спасибо большое!", "2020-12-11T15:13:10Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "128": ["Из двух Акб, одна сдохла за месяц, присутствует люфт патрона, сверла и битки из пластилина.Сколько платишь, то и получаешь. Лучше добавить копеечек и купить что то хорошее.", "2020-12-10T15:48:10Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "129": ["Одна из аккумуляторов,  при полной зарядке, при подключении к дрели не работает. Возврат товара не осуществляют и не рассматривают в течении 10 дней. Обман покупателей!!!", "2020-12-10T14:23:50Z", "черный", "0", 1, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "144": ["Один аккумулятор мертвый. Пришлось разбирать и банки на алике заказывать", "2020-12-02T23:16:59Z", "черный", "0", 1, 1, 2, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "146": ["Всем кому не понравился крутите пальцем!! Рекомендую! Очень хороший шурик.в руках патрон не удержишь.крутит бодро", "2020-12-02T12:46:46Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка