ка - 13 шт", "DEKO"], "181": ["Получилось купить только со второго раза. В первый не работала одна батарея. В целом муж не нарадуется. Летом брали отцу, тоже доволен. Крутит хорошо, удобный, кейс хороший", "2020-11-17T00:03:29Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "186": ["Брал 2 шуруповерта у одного один аккумулятор не работает", "2020-11-15T17:45:13Z", "черный", "0", 1, 0, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "187": ["Все прекрасно работает", "2020-11-14T18:08:11Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "188": ["Патрон не держит сверла плотно не зажимает", "2020-11-14T10:40:26Z", "черный", "0", 1, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "189": ["Ну что могу сказать, он удобный, мощный, и заряд держит долго но сломался быстро, сам крутящий момент в шуруповерте накрылся и прокручиваеться не открутить не закрутить, даже не знаю что и думать теперь!", "2020-11-14T03:21:45Z", "черный", "0", 1, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "191": ["Очень понравился шуруповерт,немного бьёт патрон,но это не критично,кто то писал что на первой скорости можно остановить,ни чего подобного,дури в этом малыше хватает,еще взял сверла там же,тоже очень хорошие,берите!!!", "2020-11-12T16:00:41Z", "черный", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "192": ["Шурик в целом хороший, заявленная мощность вряд ли есть, в скоростном режиме можно рукой остановить патрон если очень сильно зажать, срабатывает защита и отключает мотор, но сверлит дерево сверлом 10 нормально, обороты хорошие