, "2020-06-28T09:04:49.929002626Z", "черный", "0", 2, 1, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "535": ["Хороший шуруповерт.\r\nНедостатки: Зарядное устройство очень слабое, ток  0,4А. Время зарядки аккумулятора 3,5 часа.\r\nЕсли предполагается работать шуриком весь день, то необходимо купить новое зарядное устройство на 1,5А.", "2020-06-28T02:41:32.918001707Z", "черный", "0", 2, 0, 3, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "536": ["Не работает второй аккумулятор", "2020-06-27T15:01:13.944543934Z", "черный", "0", 1, 1, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "537": ["Шуруповёрт хороший, как дрель, конечно, слабоват. Оргалит просверлил один раз, на второй сломалось самое тонкое сверло, так что использовать лучше только на дереве. Кстати свёрла плохо фиксируются, проскальзывают в процессе. Как к шуруповёрту претензий нет, все работает, даже заряженный пришёл. В комплекте идёт 6 свёрл, 6 бит и один переходник на головки, блок питания, аккумулятор, инструкция. Можно подключать к сети или работать с аккумулятором. Муж доволен, для дома пойдёт мебель собирать, что-то просверлить тонкое. Все режимы и скорости работают. За такую цену хорошо.", "2020-06-27T12:37:22.342771704Z", "черный", "0", 3, 2, 4, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "540": ["за свои 2ооо тысячи не плох.... Комплектация полная, исправен. Позже отпишусь по работе.", "2020-06-27T07:45:03.213480383Z", "черный", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "542": ["оба аккумулятора работают примерно одинаково по времени, т. е. оба живые. биты их комплекта средние, не самые пластилиновые, но и не самые крутые, а вот сверла очень порадовали, что удивительно для комплектной оснастки и приятно. к шуруповерту нареканий нет - все очень прилично, думаю, даже заявленные 30 Нм он даёт, 180мм саморезы в дерево загоняет очень неплохо. непривычно - не поставишь на плоскость, только положить можно, т. к. у аккумулятора нет площадки. есть большая вероятность, что батарея ремонтопригодна и можно будет заменить элементы 18650 в будущем на более емкие, когда эти выдохнутся. ручка чуть менее удобна, чем у схожей по цене Пармы, но не настолько, чтобы на это обращать внимание. за те деньги, что он стоит (2100-2500) однозначно отличный вариант.", "2020-06-26T20:47:48.01355998Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "543": ["Заказала два шуруповёрт этого бренда. Хотела сравнить   И купить тот, который больше понравится. Так вот теперь, оказывается, нельзя вскрыть товар, и если не понравился, отказаться ( со слов сотрудника). Сказали, можно только вернуть по браку. Посоветовали посмотреть вживую в другом магазине, а купить в WB! Интересно, много ли покупателей вернётся в WB из тех магазинов где будут смотреть такие же товары), думаю - нет! WB - разочаровываете с каждым днём все сильнее! PS второй шуруповёрт купила, пришёл в рабочем состоянии. ", "2020-06-26T19:17:41.883841266Z", "черный", "0", 2, 5, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "547": ["Нам не повезло. Запасной аккумулятор не работает, хотя заряжали несколько часов и индикатор показал, что аккумулятор заряжен. Пытаюсь вернуть.", "2020-06-25T10:10:10.050475428Z", "черный", "0", 2, 0, 2, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "548": ["По качеству нареканий минимум, только зазоры в с борке, все работает зарядка, подсветка, минусом заметил единственное только что не чётко переключает скорость с первой на вторую чутка закусывает клавишу в остальном норма, шайба патрона супер, зажим шайбы хороший, прорезинен и удобная ручка, по времени батареи не испытывал, могу сравнить с шуриком союз, союз менее удобный и грамосткий по цене союз дороже на 2000₽ хотя собран там же где и деккр, разницу пока что не заметил все то же самое но цена просто удивила и сравнении кейс на много компактнее и есть место под биты и сверла и плюсом они не балтаются и седят в своём месте + можно докупить набор бит и вставить место где балтаются не будут. \n Ставлю твёрдую пятёрку!!!!", "2020-06-24T21:07:22.803489732Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "550": ["Не работает второй аккумулятор", "2020-06-24T06:46:03.828312657Z", "черный", "0", 1, 0, 1, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "553": ["Пришло всё быстро,без дефектов,в плёнке,проверил всё работает.", "2020-06-23T09:07:01.525893439Z", "черный", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "556": ["Шурик зверь для своего класса благодаря удачной ак. батарее. Упаковка заводская. Описанию, характеристикам соответствует.", "2020-06-21T18:27:41.472944633Z", "черный", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "557": ["для своей цены шурик отличный. Брал его на работу для проверки, все отлично.Нет фиксации шпинделя, да это и не нужно особо.Индикатор заряда видимо просто для красоты", "2020-05-11T09:37:50.573635278Z", "черный", "0", 3, 0, 5, "Дрель-шуруповерт аккумуляторная GCD12DU3 Li-Ion SET 3 в кейсе, 32Нм, 12В, 2х1.5Ач, оснастка - 13 шт", "DEKO"], "558": ["Шурик порадовал.Работаю им уже несколько месяцев.Есть недостатки, например некорректное отображение уровня заряда батареи, показывает уже  когда батарея разрядится, нет б